import logo from "../images/divumlogo.png";
import { useState } from "react";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import formValidate  from '../ValidateForm';
import setError from "../setError";

// import moment from 'moment';
// import 'react-datetime/css/react-datetime.css';
function AddUser() {
  const [email, setEmail] = useState("");
  const [firstname, setFirstname] = useState("");
  const [lastname, setLastname] = useState("");
  const [mobile_no, setMobile_no] = useState("");
  const [dob, setDob] = useState("");
  const [address, setAddress] = useState("");

  const navigate = useNavigate();

  const handleOnSubmit = async (e) => {


        e.preventDefault();

         if(valid()){
          let result = await fetch("http://localhost:3002/getUsers", {
          method: "post",
          body: JSON.stringify({
            email,
            firstname,
            lastname,
            mobile_no,
            dob,
            address,
          }),
          headers: {
            "Content-Type": "application/json",
          },
        });

            try {
              const jsonData = JSON.parse(result);
              result = await result.json();
              console.warn(result);
              if (result) {
                alert("Data saved succesfully");
                setEmail("");
                setFirstname("");
                setLastname("");
                setMobile_no("");
                setDob("");
                setAddress("");

              }
              navigate("/getUsers");

            } catch (error) {

              valid();
              console.log(error,result)

            }
         }










  };

const valid =() => {
  const dataError =document.querySelectorAll('.error');
  const dataSuccess = document.querySelectorAll('.success');
  if(dataArray.length==0&&dataSuccess==6)
  {
    console.log("empty")
    return true;
  }
  console.log(dataSuccess)
  return false;

}

  return (
    <>
      <div className="logo ">
        <img src={logo} alt="logo" className="logo" />
      </div>
      <section>
        <div className="container">
          <form id="form">
            <div className="row100">
              <div className="col">
                <div className="inputBox">
                  <input
                    type="text"
                    value={firstname}
                    id="fname"
                    name="fname"
                    onChange={(e) => setFirstname(e.target.value)}
                    onBlur={(e) => formValidate(e.target.id)}
                    // autoComplete="off"
                  />
                  <span className="text">First Name</span>
                  <span className="line"></span>
                  <div className="errormsg"></div>
                </div>
              </div>
              <div className="col">
                <div className="inputBox">
                  <input
                    type="text"
                    value={lastname}
                    id="lname"
                    name="lname"
                    onChange={(e) => setLastname(e.target.value)}
                    onBlur={(e) => formValidate(e.target.id)}
                    // autoComplete="off"
                  />
                  <span className="text">Last Name</span>
                  <span className="line"></span>
                  <div className="errormsg"></div>
                </div>
              </div>
            </div>
            <div className="row100">
              <div className="col">
                <div className="inputBox">
                  <input
                    type="text"
                    value={email}
                    id="email"
                    name="email"
                    onChange={(e) => setEmail(e.target.value)}
                    onBlur={(e) => formValidate(e.target.id)}
                    autoComplete="off"
                  />
                  <span className="text">Email</span>
                  <span className="line"></span>
                  <div className="errormsg"></div>
                </div>
              </div>
              <div className="col">
                <div className="inputBox">
                  <input
                    type="date"
                    value={dob}
                    id="dob"
                    name="dob"
                    onChange={(e) => setDob(e.target.value)}
                    onBlur={(e) => formValidate(e.target.id)}
                    max={new Date().toISOString().split("T")[0]}
                    autoComplete="off"
                  />

                  <span className="text">Date Of Birth</span>
                  <span className="line"></span>
                  <div className="errormsg" style={{ position: 'relative', top: '2px' }}></div>
                </div>
              </div>
              <div className="col">
                <div className="inputBox">
                  <input
                    type="text"
                    value={mobile_no}
                    id="mobile"
                    name="mobile"
                    onChange={(e) => setMobile_no(e.target.value)}
                    onBlur={(e) => formValidate(e.target.id)}
                    autoComplete="off"
                    maxLength="10"
                  />
                  <span className="text">Mobile</span>
                  <span className="line"></span>
                  <div className="errormsg"></div>
                </div>
              </div>
            </div>

            <div className="row100">
              <div className="col">
                <div className="inputBox textarea">
                  <textarea
                    value={address}
                    id="address"
                    name="address"
                    maxLength="50"
                    onChange={(e) => setAddress(e.target.value)}
                    onBlur={(e) => formValidate(e.target.id)}
                    autoComplete="off"
                  ></textarea>
                  <span className="text">Address...</span>
                  <span className="line"></span>

                  <div style={{ position: 'relative', top: '88px' }}
                    className="errormsg"></div>
                </div>
              </div>
            </div>

            <div className="row100">
              <div className="col">
                <Link to="/getUsers">
                  <input
                    type="submit"
                    value="Submit"
                    onClick={handleOnSubmit}
                  />
                </Link>
              </div>
            </div>
          </form>
        </div>
      </section>
    </>
  );
}

export default AddUser;
